// ==UserScript==
// @name         WME Gas Stations Checker
// @namespace    https://greasyfork.org/es/scripts/536410-wme-gas-stations-checker
// @version      1.0.3
// @description  Script para detectar posibles gasolineras que no actualizan automáticamente sus precios
// @author       carlosveny
// @match        https://beta.waze.com/*editor*
// @match        https://www.waze.com/*editor*
// @exclude      https://www.waze.com/*user/*editor/*
// @icon         data:image/png;base64,
// @grant        GM_xmlhttpRequest
// @copyright    carlosveny - 2025
// @license Copyright carlosveny
// @downloadURL https://update.greasyfork.org/scripts/536410/WME%20Gas%20Stations%20Checker.user.js
// @updateURL https://update.greasyfork.org/scripts/536410/WME%20Gas%20Stations%20Checker.meta.js
// ==/UserScript==

(function() {
    'use strict';
    // ----------------------------------------------------
    // GLOBAL VARIABLES / MAIN THREAD
    // ----------------------------------------------------
    const LAYER_NAME = 'WME_Gas_Stations_Checker'
    const TAB_NAME = LAYER_NAME
    const ID_TOTAL = 'wme_gas_stations_checker_total'
    const ID_ANALIZE = 'wme_gas_stations_checker_analize'
    const ID_TABLE_CONTAINER = 'wme_gas_stations_checker_table_container'
    const ID_TABLE = 'wme_gas_stations_checker_table'
    let GAS_STATIONS = null
    let REQUESTS_COMPLETED = 0
    let INVALID_GAS_STATIONS = false
    checkWazeReady()

    const url = 'https://www.waze.com/row-SearchServer/mozi?lon=2.75850&lat=39.61733&format=PROTO_JSON_FULL&venue_id=venues.1769868.17829754.178667'

    // ----------------------------------------------------
    // MAIN FUNCTIONS
    // ----------------------------------------------------

    async function init() {
        console.log(`WME Gas Stations Checker: Initialized v${GM_info.script.version}`)
        loadCSS()
        await createTab()
        registerEvents()
        discoverGasStations()
    }

    function discoverGasStations() {
        const venues = Object.values(W.model.venues.objects)
        GAS_STATIONS = venues?.filter(venue => venue?.attributes?.categories?.includes('GAS_STATION'))
        const totalGasStations = GAS_STATIONS?.length ?? 0
        document.getElementById(ID_TOTAL).innerText = `${totalGasStations} gasolinera${totalGasStations === 1 ? '' : 's'} encontrada${totalGasStations === 1 ? '' : 's'}`
        document.getElementById(ID_TOTAL).style.color = 'orange'
        document.getElementById(ID_ANALIZE).disabled = totalGasStations === 0
    }

    function analizeGasStations() {
        getMapLayer().removeAllFeatures()
        triggerSpinner(true)
        document.getElementById(ID_TABLE_CONTAINER).innerHTML = ''
        INVALID_GAS_STATIONS = false
        REQUESTS_COMPLETED = 0
        const coordinates = getCenterCoordinates()
        GAS_STATIONS?.forEach(gasStation => {
            makeRequest(coordinates.lat, coordinates.lon, gasStation)
        })
    }

    function makeRequest(lat, lon, venue) {
        GM_xmlhttpRequest({
            url: `https://www.waze.com/row-SearchServer/mozi?lon=${lon}&lat=${lat}&format=PROTO_JSON_FULL&venue_id=venues.${venue.attributes.id}`,
            method: 'GET',
            onload: function(response) {
                const venueFull = JSON.parse(response.responseText)
                const providers = venueFull?.venue?.external_providers?.map(provider => provider?.provider) ?? []
                if (!isGasStationValid(providers)) {
                    invalidGasStation(venue, venueFull, providers)
                }

                REQUESTS_COMPLETED++
                if (REQUESTS_COMPLETED === GAS_STATIONS?.length) {
                    triggerSpinner(false)
                    document.getElementById(ID_TOTAL).style.color = 'green'
                    document.getElementById(ID_TOTAL).innerText =  document.getElementById(ID_TOTAL).innerText.replace('encontrada', 'analizada')
                    if (!INVALID_GAS_STATIONS) {
                        document.getElementById(ID_TABLE_CONTAINER).innerHTML = '<p style="font-size: 1.1rem; font-weight: 500; margin-top: 1rem; color: green">No hay ninguna gasolinera con conflictos!</p>'
                    }
                }

            }
        })
    }

    function isGasStationValid(providers) {
        return providers?.includes('Minetur.gob.es')
    }

    function invalidGasStation(venue, venueFull, providers) {
        INVALID_GAS_STATIONS = true
        createTable()

        const row = document.createElement('tr')
        const nameCell = document.createElement('td')
        nameCell.innerText = venueFull?.venue?.name
        const providersCell = document.createElement('td')
        providersCell.innerText = providers.join(', ')
        const actionsCell = document.createElement('td')
        const navigateButton = document.createElement('button')
        navigateButton.innerHTML = '<i class="fa fa-eye"></i>'
        navigateButton.onclick = () => navigateToVenue(venue)
        actionsCell.appendChild(navigateButton)

        row.appendChild(nameCell)
        row.appendChild(providersCell)
        row.appendChild(actionsCell)
        document.getElementById(ID_TABLE).appendChild(row)

        drawGasStationSign(venue)
    }

    function navigateToVenue(venue) {
        const coordinates = getVenueCoordinates(venue)
        if (coordinates) {
            W.map.setCenter(coordinates)
        }
    }


    // ----------------------------------------------------
    // HTML FUNCTIONS
    // ----------------------------------------------------

    function drawGasStationSign(venue) {
        const coordinates = getVenueCoordinates(venue)
        if (coordinates) {
            const point = new OpenLayers.Geometry.Point(coordinates.lon, coordinates.lat)
            const feature = new OpenLayers.Feature.Vector(point, null, {
                pointRadius: 20,
                fillColor: "#fef5c3",
                fillOpacity: 1,
                strokeColor: "#ffa500",
                strokeWidth: 3,
                label: "⛽",
                fontColor: "#333",
                fontSize: "18px",
                fontFamily: "sans-serif",
                fontWeight: "bold",
                labelAlign: "cm"
            })
            getMapLayer().addFeatures([feature])
        }
    }

    async function createTab() {
        const { tabLabel, tabPane } = W.userscripts.registerSidebarTab(TAB_NAME)
        tabLabel.innerHTML = '<svg style="height:0.75rem" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512"><!--!Font Awesome Free 6.7.2 by @fontawesome - https://fontawesome.com License - https://fontawesome.com/license/free Copyright 2025 Fonticons, Inc.--><path d="M32 64C32 28.7 60.7 0 96 0L256 0c35.3 0 64 28.7 64 64l0 192 8 0c48.6 0 88 39.4 88 88l0 32c0 13.3 10.7 24 24 24s24-10.7 24-24l0-154c-27.6-7.1-48-32.2-48-62l0-64L384 64c-8.8-8.8-8.8-23.2 0-32s23.2-8.8 32 0l77.3 77.3c12 12 18.7 28.3 18.7 45.3l0 13.5 0 24 0 32 0 152c0 39.8-32.2 72-72 72s-72-32.2-72-72l0-32c0-22.1-17.9-40-40-40l-8 0 0 144c17.7 0 32 14.3 32 32s-14.3 32-32 32L32 512c-17.7 0-32-14.3-32-32s14.3-32 32-32L32 64zM96 80l0 96c0 8.8 7.2 16 16 16l128 0c8.8 0 16-7.2 16-16l0-96c0-8.8-7.2-16-16-16L112 64c-8.8 0-16 7.2-16 16z"/></svg>'
        tabLabel.title = 'Gas Stations Checker'

        tabPane.appendChild(getTabHeader())
        tabPane.appendChild(getTabContent())
        tabPane.appendChild(getTabFooter())

        await W.userscripts.waitForElementConnected(tabPane)
    }

    function getTabHeader() {
        let header = document.createElement("div")
        header.innerHTML = `
          <h6 style="margin: 0">Gas Stations Checker</h6>
          <p>v${GM_info.script.version}</p>
        `
        return header
    }

    function getTabFooter() {
        let footer = document.createElement("div")
        footer.innerHTML = `
           <hr style="margin-bottom: 0.5rem">
           <div style="font-size: 0.8rem; display: flex; gap: 1rem">
             <a href="https://carlosveny.com" target="_blank">carlosveny.com</a>
             <a href="https://www.waze.com/user/editor/carlosveny" target="_blank">WME carlosveny</a>
           </div>
        `;
        return footer
    }

    function getTabContent() {
        const totalDiv = document.createElement('p')
        totalDiv.setAttribute('id', ID_TOTAL)
        totalDiv.style.margin = 0

        const analizeButton = document.createElement('button')
        analizeButton.setAttribute('id', ID_ANALIZE)
        analizeButton.innerText = "Analizar"
        analizeButton.onclick = analizeGasStations

        const headerContent = document.createElement('div')
        headerContent.style.display = 'flex'
        headerContent.style.justifyContent = 'space-between'
        headerContent.style.alignItems = 'center'


        headerContent.appendChild(totalDiv)
        headerContent.appendChild(analizeButton)

        const tableContainer = document.createElement('div')
        tableContainer.setAttribute('id', ID_TABLE_CONTAINER)

        const contentContainer = document.createElement('div')
        contentContainer.appendChild(headerContent)
        contentContainer.appendChild(tableContainer)

        return contentContainer
    }

    function createTable() {
        if (!document.getElementById(ID_TABLE)) {
            const table = document.createElement('table')
            table.setAttribute('id', ID_TABLE)
            table.innerHTML = `
              <tr>
                <th>Nombre</th>
                <th>Proveedores</th>
                <th><i class="fa fa-map-pin" style="display: flex; justify-content: center"></i></th>
              </tr>`
            document.getElementById(ID_TABLE_CONTAINER).innerHTML = '<p style="font-size: 1.1rem; font-weight: 500; margin-top: 1rem">Gasolineras con conflictos:</p>'
            document.getElementById(ID_TABLE_CONTAINER).appendChild(table)
        }
    }

    function triggerSpinner(activate) {
        if (activate) {
            const spinnerContainer = document.createElement('span')
            spinnerContainer.setAttribute('class', 'loader-container')
            const spinner = document.createElement('span')
            spinner.setAttribute('class', 'loader')
            spinnerContainer.appendChild(spinner)
            document.getElementById(ID_ANALIZE).style.color = 'transparent'
            document.getElementById(ID_ANALIZE).appendChild(spinnerContainer)
            document.getElementById(ID_ANALIZE).disabled = true
        } else {
            document.getElementById(ID_ANALIZE).innerHTML = 'Analizar'
            document.getElementById(ID_ANALIZE).style.color = 'white'
        }
    }

    function loadCSS() {
        const style = document.createElement('style')
        style.textContent = `
          #${ID_TABLE} {
            border-collapse: collapse;
            width: 100%;
            td, th {
              border: 1px solid #dddddd;
              text-align: left;
              padding: 2px;
            }
            button {
              border: 0;
              background-color: transparent;
              padding: 0;
              height: 100%;
            }
          }
          #${ID_ANALIZE}:disabled {
            opacity: 0.4;
          }
          #${ID_ANALIZE}:hover:not(:disabled) {
            background-color: #0585db
          }
          #${ID_ANALIZE} {
            margin: 0;
            background-color: #0099ff;
            color: white;
            padding: .2rem .75rem;
            border-radius: 1rem;
            border: 0;
            position: relative;

            .loader-container {
              position: absolute;
              top: 50%;
              left: 50%;
              transform: translate(-50%, -50%);
            }
            .loader {
              width: 12px;
              height: 12px;
              border: 2px solid #FFF;
              border-bottom-color: transparent;
              border-radius: 50%;
              display: inline-block;
              box-sizing: border-box;
              animation: rotation 1s linear infinite;
            }
          }

          @keyframes rotation {
            0% {
              transform: rotate(0deg);
            }
            100% {
              transform: rotate(360deg);
            }
          }`

        document.head.appendChild(style)
    }


    // ----------------------------------------------------
    // WME CORE FUNCTIONS
    // ----------------------------------------------------

    function checkWazeReady() {
        if (W?.userscripts?.state.isReady) {
            init()
        } else {
            setTimeout(checkWazeReady, 1500)
        }
    }

    function registerEvents() {
        W.map.olMap.events.register('moveend', null, discoverGasStations)
        W.map.olMap.events.register('zoomend', null, timeoutZoom)
    }

    function timeoutZoom() {
        setTimeout(discoverGasStations, 1000);
    }

    function getCenterCoordinates() {
        const center = W.map.getCenter()
        const center4326 = OpenLayers.Projection.transform(
            center,
            W.map.getProjectionObject(),
            new OpenLayers.Projection("EPSG:4326")
        );
        const lat = Math.round(center4326.lat * 1000000) / 1000000
        const lon = Math.round(center4326.lon * 1000000) / 1000000
        return new OpenLayers.LonLat(lon, lat)
    }

    function transformCoordinates(lat, lon) {
        return new OpenLayers.LonLat(lat, lon).transform(
            new OpenLayers.Projection("EPSG:4326"),
            W.map.getProjectionObject()
        )
    }

    function getMapLayer() {
        let layer = W.map.getLayerByName(LAYER_NAME);
        if (!layer) {
            layer = new OpenLayers.Layer.Vector(LAYER_NAME);
            layer.setZIndex(999999)
            W.map.addLayer(layer);
        }
        return layer;
    }

    function getVenueCoordinates(venue) {
        const coordinates = venue?.attributes?.geoJSONGeometry?.type === 'Point'
        ? venue?.attributes?.geoJSONGeometry?.coordinates
        : venue?.attributes?.geoJSONGeometry?.coordinates[0][0]
        if (!coordinates) return null
        return new OpenLayers.LonLat(coordinates[0], coordinates[1]).transform(
            new OpenLayers.Projection("EPSG:4326"),
            W.map.getProjectionObject()
        )
    }
})()